import React, { Component } from 'react';
import TextCard from './TextCard/TextCard';
import Button from '../Button/Button'

class BodyCard extends Component {
    render (){

    const texto1 = 'Estas perdiendo clientes potenciales via caneles digitales sin tener presencia digital';
    const texto2 = 'No solo con tener un sitio web es suficiente, es necesario tambien conocer el estado de tus ingresos via caneles digitales y de donde vienen.';
    const texto3 = 'Via web podras mostrarte de una manera mas profesional hacia tus clientes y ellos perciban la seriedad del caso.';

    const gretting = 'Descubre';
    const gretting1 = 'Hablemos';

    const estiloButton = 'br4-ns br3 ba color-boton ttu white center pt2 pb2 pr4 pl4 f4 f2-ns no-underline grow';


    return (
        <div className='white mt6 ' >


            <div id='acuerdo' className='pv4 cf flex-ns flex-column justify-center-ns' >
                <div className='fl w-80 ph2 flex center '>
                    <TextCard contenido = {texto1} />
                    <TextCard contenido = {texto2} />
                    <TextCard contenido = {texto3} />
                </div>
                <p className='tc fw1 f3 f2-ns lh-title b--orange'>Conoce nuestros proyectos</p>
                <div className='fl w-80 ph2 flex center '>
                    <TextCard contenido = {texto1} />
                    <TextCard contenido = {texto2} />
                    <TextCard contenido = {texto3} />
                </div>
                <div className='center flex mt3 bg-white'>
                    <div  className='center mb3 pr4' >
                        <Button text = {gretting}  estilo = {estiloButton} onSumbitSubscription = {this.onSumbitSubscription} />
                    </div>
                    <div  className='center mb3 pl4' >
                        <Button text = {gretting1}  estilo = {estiloButton} onSumbitSubscription = {this.onSumbitSubscription} />
                    </div>    
                </div>


            </div>
        </div>
    );

    }
    }

    export default BodyCard;
